"""# Training Model

I tried to add the tensorboard to watch the prediction curve in real-time as displayed in google colab's Detectron2 tutorial, however tensorboard did not work either of the times the model was being trained so it is commented out. In the future, it would be worth while looking into this matter when doing other projects.
In order to train Detectron2's Mask R-CNN on our custom data the get_cfg() class must be instantiated. This class allows use to grab a copy of the default attributes and parameters defined in Detectron2's configuration class. When the model trains, it will produce weights and other material that will be output in the log_2 directory. Every time the model trains a new log directory should be made to capture the training output. When training an instance segmentation model, utilizing pretrained model weights may decrease training time and may increase overall model accuracy. The log and log2 directories contain information on our model trained with just a pretrained model but not the weights of the pretrained model. In order to access Detectron2's pretrained models we must pass <strong>config.merge_from_file(model_zoo.get_config_file())</strong> a pretrained model from <a>https://github.com/facebookresearch/detectron2/blob/main/MODEL_ZOO.md</a>

According to the documentation on github, every model was trained on "Big Basin servers with 8 NVIDIA V100 GPUs & NVLink." Since we are training with the MAsk R-CNN, Detectron2 provides a few models that are trained with three different backbone combinations (FPN, C4, DC5). As stated before, since our time is limited, the FPN or Feature Pyramind Network would offer the fastest training time compared to others. The documentation states "FPN: Use a ResNet+FPN backbone with standard conv and FC heads for mask and box prediction, respectively. It obtains the best speed/accuracy tradeoff."

The following information can be obtained from the github repository:

_BASE_: "../Base-RCNN-FPN.yaml"
MODEL:
  WEIGHTS: "detectron2://ImageNetPretrained/MSRA/R-50.pkl"
  MASK_ON: True
  RESNETS:
    DEPTH: 50
SOLVER:
  STEPS: (210000, 250000)
  MAX_ITER: 270000

This is what we will grab and insert into the model_zoo.get_config_file api.

The following comments in the cell on model parameters can be found through the github link as well as in the Detectron2 documentation <a>https://detectron2.readthedocs.io/en/latest/</a>
"""

