# Samples from these datasets will be merged and used as one dataset.
config.DATASETS.TRAIN = ("goat_train_clean",)
# List of the dataset names for testing. Must be registered in DatasetCatalog
config.DATASETS.TEST = ()

#DATALOADER APIs
