"""# Model Results and Discussion (Evaluation of trained model (using mean average precision mAP))

The metrics used in evaluating model performance in object detection is quite different than ordinary machine learning tasks. There are two metrics in object detection that are important to note and help determine the performance of an object detection model which are Average Precision (AP), Mean Average Precision (mAP), and Intersection Over Union (IOU). Average Precision or AP can be defined as the area underneath the precision and recall curve. For our instance segmentation model, the precision and recall curve would be created on a 2D plane by an alternating score cutoff where any object detected in an image with a score below the cutoff is treated as a false positive. This will create a value pair that is then plotted. Tensorboard would have done an excellent job of displaying this curve, however a mental depiction of the curve can be obtained from the decrease in the total loss parameter. Mean Average Precision or mAP is the average of AP values on the curve over different classes. Intersection Over Union or IOU is a confusing metric that measures the overlap between object bounding boxes. All metrics can be increased or decreased by tweaking model parameters. According to Yanfeng Lui's medium article *The Confusing Metrics of AP and mAP for Object Detection / Instance Segmentation*, a good enough model performance can between determined by AP50 or 50% IOU since it mitagates bias over a particular IOU threshold value (Liu, 2018). The model has been trained multiple times and parameters have been manipulated relentlessly to reach the perfect model, as can be seen in our log directory. The highest AP50 value logged for the bounding box is 100% for IOU threshold of 0.5 and the highest AP50 value logged for segmentation is 95% for and IOU threshold of 0.5, which is near perfect. This does not take away from the fact that evaluations from all trainings were good and showed extraordinary model performance. This is because when testing the model the predictions aren't that different.The performance of this model using logs_6 directory can be seen in the testing_model_path.ipynb file.
"""

#import the COCO Evaluator to use the COCO Metrics
from detectron2.evaluation import COCOEvaluator, inference_on_dataset
from detectron2.data import build_detection_test_loader

#Call the COCO Evaluator function and pass the Validation Dataset
config.OUTPUT_DIR = "/content/drive/MyDrive/instance_segmentation/Detectron2/logs"
evaluator = COCOEvaluator("goat_val_clean", config, False, output_dir=config.OUTPUT_DIR)
val_loader = build_detection_test_loader(config, "goat_val_clean")

#Use the created predicted model in the previous step
inference_on_dataset(inference.model, val_loader, evaluator)

